define({"topics" : [{"title":"HTTP Method","id":"concept_t4k_2hh_jw","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_t4k_2hh_jw","menu": {"hasChildren":true,},"tocID":"concept_t4k_2hh_jw-d46e68011","next":"concept_t4k_2hh_jw-d46e68011",},{"title":"Parallel Requests","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor sends multiple requests at a time. To preserve record order,         the processor waits until all\n                  requests for the entire batch are completed before processing         the next batch.\n               </p>\n            ","id":"concept_d3m_yrn_jw","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_d3m_yrn_jw","menu": {"hasChildren":false,},"tocID":"concept_d3m_yrn_jw-d46e68065","topics":[]},{"title":"Response Header Fields","id":"concept_ekz_wrz_zw","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_ekz_wrz_zw","menu": {"hasChildren":false,},"tocID":"concept_ekz_wrz_zw-d46e68110","topics":[]},{"title":"Logging Request and Response Data","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor can log request and response data to the <span class=\"ph\">Data Collector</span>         log.\n               </p>\n            ","id":"concept_dhg_gmk_hdb","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_dhg_gmk_hdb","menu": {"hasChildren":false,},"tocID":"concept_dhg_gmk_hdb-d46e68162","topics":[]},{"title":"OAuth 2 Authorization","shortdesc":"\n               <p class=\"shortdesc\">You can configure the HTTP Client processor to use the OAuth 2 protocol to connect to an         HTTP service that uses basic,\n                  digest, or universal authentication, OAuth 2 client         credentials, OAuth 2 username and password, or OAuth 2 JSON Web\n                  Tokens (JWT).\n               </p>\n            ","id":"concept_s4p_15f_5y","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_s4p_15f_5y","menu": {"hasChildren":true,},"tocID":"concept_s4p_15f_5y-d46e68231","next":"concept_s4p_15f_5y-d46e68231",},{"title":"Data Formats","shortdesc":"\n               <p class=\"shortdesc\">The HTTP Client processor writes the server response to the specified field in the         record. </p>\n            ","id":"concept_jrj_hmh_jw","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#concept_jrj_hmh_jw","menu": {"hasChildren":false,},"tocID":"concept_jrj_hmh_jw-d46e68595","topics":[]},{"title":"Configuring HTTP Client Processor","shortdesc":"\n               <p class=\"shortdesc\">Configure an HTTP Client processor to perform requests against a resource         URL.</p>\n            ","id":"task_z54_1qr_fw","href":"datacollector\/UserGuide\/Processors\/HTTPClient.html#task_z54_1qr_fw","menu": {"hasChildren":false,},"tocID":"task_z54_1qr_fw-d46e68711","topics":[]}]});